import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import LoginSpotify from './components/LoginSpotify';
import Dashboard from './components/Dashboard'; // You can keep this for Spotify data
import LoginYouTube from './components/LoginYouTube'; // Create this component for YouTube Music

const App = () => {
  return (
    <Router>
      <div>
        <h1>Music Tracker</h1>
        <Routes>
          <Route path="/" element={<LoginSpotify />} />
          <Route path="/youtube" element={<LoginYouTube />} /> {/* New route for YouTube Music */}
          <Route path="/dashboard" element={<Dashboard />} /> {/* Adjust to show combined data later */}
        </Routes>
      </div>
    </Router>
  );
};

export default App;
